import React from 'react'
import { Chart } from "react-google-charts";

class Table extends React.Component{

  netto = () =>{
  }
render(){
  console.log(this.props.total[this.props.total.length-1][1])

  return(
    <div>
    <Chart
      width={'100px'}
      height={'500px'}
      chartType="Table"
      loader={<div>Loading Chart</div>}
      data={[
        [
          { type: 'string', label: 'Coin' },
          { type: 'number', label: 'Amount' },
          { type: 'number', label: 'Initial Price per Unit (EUR)' },
          { type: 'number', label: 'Total (EUR)' },
          { type: 'number', label: 'Netto' },
          { type: 'boolean', label: 'Full Time Employee' },
        ],
        ['Mike', { v: 10000, f: '$10,000' }, true],
        ['Jim', { v: 8000, f: '$8,000' }, false],
        ['Alice', { v: 12500, f: '$12,500' }, true],
        ['Bob', { v: 7000, f: '$7,000' }, true],
      ]}
      options={{
        showRowNumber: true,
      }}
      rootProps={{ 'data-testid': '1' }}
    />
    </div>
  )
}
}

export default Table
